40	1	Whisk coconut milk, curry paste and a pinch of salt.	8
41	2	Place salmon, skin-side up in a small baking dish, and pour coconut sauce over top. Spoon sauce all over fish to cover it. Cover with plastic wrap and refrigerate for at least 2 hours.	8
