71	1	Remove skin from salmon, dice the flesh, and add into a large bowl.	12
72	2	Add in avocado, cilantro, curry powder, sea salt and stir until well mixed. Stir in 4 teaspoons tapioca starch until well incorporated.	12
73	3	Line a baking sheet with parchment paper. Form the salmon into eight 1/4 cup-sized patties, just over 1/2 inch thick, and place them onto the pan. Freeze for 20 minutes so they are easier to work with.	12
74	4	While patties freeze, preheat air fryer to 400ºF for 10 minutes, rubbing the basket with coconut oil.	12
75	5	Additionally, whisk eggs and place them into a shallow plate.	12
76	6	Place remaining 1/4 cup tapioca starch and coconut flakes in separate shallow plates as well.	12
77	7	Once patties have chilled, dip one into the tapioca starch, making sure it’s fully covered. Then dip it into the egg, covering it entirely, and gently brushing off any excess. Finally, press just the top and sides of the cake into the coconut flakes and place it, coconut-flake-side up, into the air fryer. Repeat with all cakes.	12
78	8	Gently brush the tops with a little bit of melted coconut oil (optional, but recommended) and cook until outside is golden brown and crispy, and inside is juicy and tender, about 15 minutes. The patties will stick to the Air Fryer basked a little, so use a sharp-edged spatula to remove them.	12
79	9	When cakes have about 5 minutes left to cook, heat coconut oil up in a large pan on medium heat.	12
80	10	Add arugula and spinach mix, and a pinch of salt, and cook, stirring constantly, until greens just begin to wilt, only 30 seconds to 1 minute.	12
81	11	Divide greens between plates, followed by salmon cakes.	12
82	12	Garnish with extra cilantro and devour!	12
83	13	If you want to bake these in the oven, preheat oven to 400ºF and line a baking sheet with parchment paper, placing a cooling rack on top of the pan. Rub the cooling rack with coconut oil.	12
84	14	Place patties, coconut-side up, onto cooling rack and bake for 15–17 minutes until crispy. We liked these better in the air fryer, as they do get a little crispier, but they are still good in the oven!	12
85	1	Start by cooking the eggs. Fill a small saucepan with water up to three quarters.	13
86	2	Add a good pinch of salt. This will prevent the eggs from cracking. Bring to a boil. Using a spoon or hand, dip each egg in and out of the boiling water. Be careful not to get burnt. This will prevent the egg from cracking as the temperature change won't be so dramatic. To get the eggs hard-boiled, you need round 10 minutes. This timing works for large eggs. When done, remove from the heat and place in a bowl filled with cold water. I use an egg timer.) Peel the eggs and set aside.	13
87	3	Prepare the cauliflower topping. Wash the cauliflower and cut into smaller florets.	13
88	4	Place on a steaming rack inside a pot filled with about 2 inches of water. Bring to a boil and cook for about 10 minutes. Do not overcook.	13
